import React, { Component } from "react";
import {
  Grid,
  Row,
  Col,
  ControlLabel,
  FormControl,
  Form,
  FormGroup
} from "react-bootstrap";

import { Card } from "components/Card/Card.jsx";
import { FormInputs } from "components/FormInputs/FormInputs.jsx";
import { UserCard } from "components/UserCard/UserCard.jsx";
import Button from "components/CustomButton/CustomButton.jsx";

import avatar from "assets/img/faces/face-3.jpg";

class UserProfile extends Component {
  render() {
    return (
      <div className="content">
        <Grid fluid>
          <Row>
            <Col md={12}>
              <Card
                title="Ajouter Un utilisateur"
                content={

                  <Form>
                  <FormGroup controlId="formGroupnom">
                    <ControlLabel>Nom</ControlLabel>
                    <FormControl type="name" placeholder="Enter le nom" />
                  </FormGroup>
                  <FormGroup controlId="formGroupnom">
                    <ControlLabel>Postnom</ControlLabel>
                    <FormControl type="name" placeholder="Enter le Postnom" />
                  </FormGroup>
                  <FormGroup controlId="formGroupnom">
                    <ControlLabel>Prenom</ControlLabel>
                    <FormControl as="select" custom/>
                    <option>M</option>
                    <option>F</option>
                  </FormGroup>
                  <FormGroup controlId="formGroupnom">
                    <ControlLabel>Sexe</ControlLabel>
                    <FormControl type="name" >

                    </FormControl>
                  </FormGroup>

                </Form>

                }
              />
            </Col>
          </Row>
        </Grid>
      </div>
    );
  }
}

export default UserProfile;
